import React from "react";
import "../styles/timeDuration.css"; // Import separate CSS

const TimeDuration = ({ duration, setDuration }) => {
    return (
        <div className="duration-container">
            <label>Enter Time Duration (minutes):</label>
            <input
                type="number"
                value={duration}
                onChange={(e) => setDuration(e.target.value)}
                placeholder="e.g. 120"
            />
        </div>
    );
};

export default TimeDuration;
